      /* (402) decl_func ::= func_decl SCOLON */ yytestcase(yyruleno==402);
      /* (403) stmt_brace ::= stmt (OPTIMIZED OUT) */ assert(yyruleno!=403);
      /* (404) stmt_expr ::= expr2stmt (OPTIMIZED OUT) */ assert(yyruleno!=404);
      /* (405) stmts_brace ::= stmt_brace (OPTIMIZED OUT) */ assert(yyruleno!=405);
      /* (406) stmts_brace ::= stmts_expr scolon_space stmt_brace */ yytestcase(yyruleno==406);
      /* (407) stmts_brace ::= stmts_brace SPACE stmt_brace */ yytestcase(yyruleno==407);
