      /* (410) stmts_expr ::= stmts_brace SPACE stmt_expr */ yytestcase(yyruleno==410);
      /* (411) stmts_optional2 ::= lcbrace_or_space RCBRACE */ yytestcase(yyruleno==411);
      /* (412) stmts_optional2 ::= lcbrace_or_space stmts_brace rcbrace_or_space */ yytestcase(yyruleno==412);
      /* (413) stmts_optional2 ::= lcbrace_or_space stmts_expr rcbrace_or_scolon */ yytestcase(yyruleno==413);
      /* (414) decl_struct_attrs_list ::= decl_struct_attr (OPTIMIZED OUT) */ assert(yyruleno!=414);
      /* (415) decl_struct_attrs_list ::= decl_struct_attrs_list decl_struct_attr */ yytestcase(yyruleno==415);
      /* (416) decl_struct ::= struct_decl_begin lparen_or_space RPAREN decl_struct_attrs_optional decl_struct_close_or_at */ yytestcase(yyruleno==416);
      /* (417) decl_struct ::= struct_decl_begin lparen_or_space struct_fvars rparen_or_comma decl_struct_attrs_optional decl_struct_close_or_at */ yytestcase(yyruleno==417);
      /* (418) decl_enum ::= enum_decl_begin lbracket_or_space RBRACKET enum_base_begin enum_base_end decl_enum_close_or_at */ yytestcase(yyruleno==418);
      /* (419) decl_enum ::= enum_decl_begin lbracket_or_space enum_cvars rbracket_or_comma enum_base_begin enum_base_end decl_enum_close_or_at */ yytestcase(yyruleno==419);
      /* (420) decl_gvar_list ::= decl_gvar (OPTIMIZED OUT) */ assert(yyruleno!=420);
      /* (421) decl_gvar_list ::= decl_gvar_list decl_gvar */ yytestcase(yyruleno==421);
      /* (422) decl_gvars ::= VAR SPACE decl_gvar_list SCOLON */ yytestcase(yyruleno==422);
